import React, { Component } from 'react';

class Sandbox extends Component {
    render() {
        doJob('ISS', alertFinished);
        return(<h></h>);
    }
}

function doJob(subject, callback) {

    alert(`Starting my ${subject} Job.`);

    //Simulating a job time
    setTimeout(() => {
        callback();    
    }, 3000);
}

//This func gets executed ONLY AFTER being the execution of the first function ends.
function alertFinished() {
    alert('Finished my job');
}

export default Sandbox;
